import React from 'react';
import ReactDOM from 'react-dom';

class Determination extends React.Component{
    constructor(props)
    {
      super(props);
      this.state =
      {
      score: "40"
      }
    }
    render(){
      return <ExamChecker score={this.state.score}/>
    }
}


const ExamChecker = (props) => (Number(props.score)>30?<h1>Passed!</h1>:<h1>Faild</h1>)
ReactDOM.render(
          <Determination/>,
          document.getElementById('root')
          );
